actionConfiguration.body:
(docType, userRole) => {
		let response = '-';
		const record = listDocVerStatuses.data.find((i) => i.KYC_DOCUMENT_TYPE === docType && i.VERIFIED_BY_ROLE === userRole);
		if(record) {
			if(record.VERIFICATION_STATUS === 's') {
				response = 'Success';
			} else if(record.VERIFICATION_STATUS === 'f') {
				response = 'Failure';
			}
		}
		return response;
	}

